import React from 'react'

class Game extends React.Component {
    render() {
        var cardWidth = 71.2;
        var cardHeight = 94;
        var xOffset = 0;
        var yOffset = 0;
        return (
            <div class='Game'>
             <div class='Card' style={{'background-image': 'url(https://img.itch.zone/aW1hZ2UvNzE1Mzg3LzM5NjQ5MzEucG5n/original/iwG3hK.png)',
                                       width: cardWidth + 'px',
                                       height: cardHeight + 'px',
                                       overflow: 'hidden',
                                       'background-position': xOffset * cardWidth + 'px ' + (yOffset + 1) * cardHeight + 'px'}} />
             <p>The game board goes here</p>
            </div>
        );
    }
}
export default Game;
